DefineTests[
	PageSections,
	{
		Example[{Basic, "Returns a sections path, starting with the page, as a List:"},
			PageSections[Object[Protocol, SampleManipulation, Aliquot, "id:qdkmxzqebpn3"]],
			{Object[Notebook, Page, "id:ksljkjsl"], "Experimental Analysis (pt 2)", "Running Controls (pt 2)", "System Suitability Check"},
			Stubs :> {
				Search[types_List, _List, ___]:=Table[{Object[Notebook, Page, "id:ksljkjsl"]}, {Length[types]}],
				Download[x_List, {SectionsJSON, TemplateSectionsJSON, InstanceSectionsJSON}]:=Table[{sval, $Failed, $Failed}, {Length[x]}]
			}
		],
		Example[{Basic, "Returns is Listable:"},
			PageSections[{
				Object[Protocol, SampleManipulation, Aliquot, "id:qdkmxzqebpn3"],
				Object[Protocol, HPLC, "id:6V0npvmJWw7w"]
			}],
			{
				{Object[Notebook, Page, "id:ksljkjsl"], "Experimental Analysis (pt 2)", "Running Controls (pt 2)", "System Suitability Check"},
				{Object[Notebook, Page, "id:ksljkjsl"], "Experimental Analysis (pt 2)", "Running Experiments", "Final 33 Samples in plate", "Materials & Methods"}
			},
			Stubs :> {
				Search[types_List, _List, ___]:=Table[{Object[Notebook, Page, "id:ksljkjsl"]}, {Length[types]}],
				Download[x_List, {SectionsJSON, TemplateSectionsJSON, InstanceSectionsJSON}]:=Table[{sval, $Failed, $Failed}, {Length[x]}]
			}
		],
		Example[{Basic, "If an object was not associated with a Command Center Page, or it is not part of the SectionsJSON for a page, it returns empty list:"},
			PageSections[{
				Object[Sample, "id:6V0npvK7Y0m8"],
				Object[Protocol, HPLC, "id:6V0npvmJWw7w"]
			}],
			{{}, {}},
			Stubs :> {
				Search[types_List, _List, ___]:=Table[{}, {Length[types]}],
				Download[x_List, {SectionsJSON, TemplateSectionsJSON, InstanceSectionsJSON}]:=Table[{Null, $Failed, $Failed}, {Length[x]}]
			}
		],
		Example[{Additional, "Works with objects that come from Object[Notebook, Script]s:"},
			PageSections[Object[Protocol, SampleManipulation, Aliquot, "id:qdkmxzqebpn3"]],
			{Object[Notebook, Script, "id:fakescript"], "Experimental Analysis (pt 2)", "Running Controls (pt 2)", "System Suitability Check"},
			Stubs :> {
				Search[types_List, _List, ___]:=Table[{Object[Notebook, Script, "id:fakescript"]}, {Length[types]}],
				Download[x_List, {SectionsJSON, TemplateSectionsJSON, InstanceSectionsJSON}]:=Table[{$Failed, sval, Null}, {Length[x]}]
			}
		],
		Example[{Messages, "InvalidJSONSections", "If the SectionsJSON was saved incorrectly, this message is thrown:"},
			PageSections[Object[Protocol, SampleManipulation, Aliquot, "id:qdkmxzqebpn3"]],
			{Object[Notebook, Page, "id:ksljkjsl"]},
			Stubs :> {
				Search[types_List, _List, ___]:=Table[{Object[Notebook, Page, "id:ksljkjsl"]}, {Length[types]}],
				Download[x_List, {SectionsJSON, TemplateSectionsJSON, InstanceSectionsJSON}]:=Table[{"al;ksdjfa;slkdjfasd", $Failed, $Failed}, {Length[x]}]
			},
			Messages :> {
				Message[BaseDecode::decfail], Message[ImportByteArray::barray], Message[PageSections::InvalidJSONSections]
			}
		]
	}
];

