DefineTests[
	ImportJSONToAssociation,
	{
		Example[{Basic, "Imports a json string to an association:"},
			ImportJSONToAssociation["{\"a\": \"b\"}"],
			<|"a" -> "b"|>
		],
		Example[{Basic, "Imports a json in list form:"},
			ImportJSONToAssociation["[{\"a\": \"b\"},{\"c\": \"d\"}]"],
			{<|"a" -> "b"|>, <|"c" -> "d"|>}
		],
		Example[{Basic, "Imports a json containing unicode characters that typically fail with ImportString:"},
			ImportJSONToAssociation["{\"a\":\"\"}"],
			<|"a" -> ""|>
		],
		Example[{Basic, "Imports a json containing special characters:"},
			ImportJSONToAssociation["{\"Items\":\"20. pounds\\[Hyphen]force per inch squared\"}"],
			<|"Items" -> "20. poundsforce per inch squared"|>
		]
	}
];

DefineTests[
	ExportAssociationToJSON,
	{
		Example[{Basic, "Exports an association to a json string:"},
			ExportAssociationToJSON[<|"a" -> "b"|>],
			"{\"a\":\"b\"}"
		],
		Example[{Basic, "Exports a nested association to a json string:"},
			ExportAssociationToJSON[<|"a" -> <|"c" -> "d"|>|>],
			"{\"a\":{\"c\":\"d\"}}"
		],
		Example[{Options, PrettyOutput, "Exports an association to a json string with indentation:"},
			ExportAssociationToJSON[<|"a" -> "b"|>, PrettyOutput->True],
			"{\n\t\"a\":\"b\"\n}"
		]
	}
];